let tooltipDisabledInstance = null;
module.exports = class tooltipDisabled {

    constructor() {
        if (!tooltipDisabledInstance) {
            tooltipDisabledInstance = this;
            //set all other default values

            this.displayAs = 'Tooltip Disabled';
            this.value = '[tooltipDisabled]'
            this.type = 'TOGGLE';
            this.values = {'true-value':'true', 'false-value': 'false'}
        }
        return tooltipDisabledInstance;
    }
}